<script>
import {mapGetters, mapActions} from 'vuex';
import axios from '../axios';

export default {
  name: "Blog",
  computed:
      {
        ...mapGetters(
            {
              newComment: "comment/newComment"
            }),
      },
  data() {
    return {
      newComment: "",
      post: undefined,
      comments: undefined,
      Author: undefined,
    }
        ;
  },

  mounted() {
    this.loadPost();
  },
  methods: {
    ...mapActions({
      createNewComment: "comment/createNewComment"
    }),
    loadPost: function () {
      axios
          .get('Res')
          .then((res) => {
            this.post = res.data.data.Post;
            this.comments = res.data.data.Comment;
            this.Author = res.data.data.User;
          })
          .catch(err => {
            console.error(err);
          });
    },
  },

}
;
</script>
